import React from 'react';

const Action = ({ action }) => {
  return (
    <li>
        <button className="btn btn-link p-0"><h5 className="text-secondary font-weight-bold">{action.name}</h5></button>
        <p>
            {action.description}
            <button className="btn btn-link p-0 text-primary ml-2">Read More..</button>
        </p>
    </li>
  );
}

export default Action;
